import React from 'react';
import '../css/styles.css';

const MyApp = ({ Component, pageProps }) => {

    return (
        <div>
            <div className="bg-gray-400 p-4">
                <div className="container mx-auto">
                    Palpeite-Box
                </div>
            </div>
            <div className="container mx-auto">
                <Component { ...pageProps }/>
            </div>
        </div>
    );

};

export default MyApp;
